import React, { useState, useEffect } from 'react';
import Papa from 'papaparse';

const ServicosCSV = () => {
  const [dadosCSV, setDadosCSV] = useState<any[]>([]);
  const [codigoBusca, setCodigoBusca] = useState('');
  const [resultado, setResultado] = useState<any | null>(null);

  useEffect(() => {
    const carregarCSV = async () => {
      const response = await fetch('../sintetico.csv');
      const textoCSV = await response.text();
      
      Papa.parse(textoCSV, {
        complete: (result) => {
          setDadosCSV(result.data);
        },
      });
    };

    carregarCSV();
  }, []);

  const buscarServico = () => {
    const servicoEncontrado = dadosCSV.find((item) => item[0] === codigoBusca);
    setResultado(servicoEncontrado || 'Serviço não encontrado');
  };

  return (
    <div>
      <h1>Buscar Serviço</h1>
      <input 
        type="text" 
        value={codigoBusca} 
        onChange={(e) => setCodigoBusca(e.target.value)} 
        placeholder="Digite o código do serviço"
      />
      <button onClick={buscarServico}>Buscar</button>
      {resultado && (
        <div>
          {Array.isArray(resultado) ? (
            <div>
              <h3>Resultado Encontrado:</h3>
              <p><strong>Código:</strong> {resultado[0]}</p>
              <p><strong>Especificação:</strong> {resultado[1]}</p>
              <p><strong>Unidade:</strong> {resultado[2]}</p>
              <p><strong>Material:</strong> {resultado[3]}</p>
              <p><strong>Mão de Obra:</strong> {resultado[4]}</p>
              <p><strong>Total:</strong> {resultado[5]}</p>
            </div>
          ) : (
            <p>{resultado}</p>
          )}
        </div>
      )}
    </div>
  );
};

export default ServicosCSV;
